        self.Omega_01_3[1, 0] = numpy.cos(self.tilt)*numpy.cos(self.eta + self.q[15] + self.theta)*self.q_dot[14]
        self.Omega_01_3[1, 2] = numpy.sin(self.eta + self.q[15] + self.theta)*numpy.cos(self.tilt)*self.q_dot[14]
        self.Omega_01_3[2, 0] = -numpy.sin(self.tilt)*self.q_dot[14]
        self.Omega_01_3[2, 1] = -numpy.sin(self.eta + self.q[15] + self.theta)*numpy.cos(self.tilt)*self.q_dot[14]
        #
        self.Omega_01_4 = numpy.zeros((3, 3), dtype=float)
        self.Omega_01_4[0, 1] = (numpy.sin(self.cone)*numpy.sin(self.tilt) - numpy.cos(self.cone)*numpy.cos(self.tilt)*numpy.cos(self.eta + self.q[15] + self.theta))*self.q_dot[14]
        self.Omega_01_4[0, 2] = (numpy.sin(self.cone)*numpy.cos(self.tilt)*numpy.cos(self.eta + self.q[15] + self.theta) + numpy.sin(self.tilt)*numpy.cos(self.cone))*self.q_dot[14]
        self.Omega_01_4[1, 0] = (-numpy.sin(self.cone)*numpy.sin(self.tilt) + numpy.cos(self.cone)*numpy.cos(self.tilt)*numpy.cos(self.eta + self.q[15] + self.theta))*self.q_dot[14]
