        self.Omega_01_4[2, 0] = -(numpy.sin(self.cone)*numpy.cos(self.tilt)*numpy.cos(self.eta + self.q[15] + self.theta) + numpy.sin(self.tilt)*numpy.cos(self.cone))*self.q_dot[14]
        self.Omega_01_4[2, 1] = -numpy.sin(self.eta + self.q[15] + self.theta)*numpy.cos(self.tilt)*self.q_dot[14]
